INSERT INTO `events` (`id`, `event_id`, `type`, `title`, `url`, `shortener_url`, `description`, `started_at`, `ended_at`, `limit_number`, `address`, `place`, `lat`, `lon`, `cost`, `max_prize`, `currency_unit`, `owner_id`, `owner_nickname`, `owner_name`, `attend_number`, `substitute_number`, `created_at`, `updated_at`, `informed_from`, `state`, `og_image_info`) VALUES (650484,'1436440903074320384','HackathonEvent','IDEATHON WTM CENTRAL AFRICA | Google Developer Groups','https://gdg.community.dev/events/details/google-gdg-yaounde-presents-ideathon-wtm-central-africa/',NULL,'Skip to main content\nThis site uses cookies to deliver its services and analyze traffic. You can learn more about how Google uses cookies here, and how Bevy uses cookies here.\nOK\nIDEATHON WTM CENTRAL AFRICA\nGDG Yaound\nSat, Sep 11, 10:00 AM (WAT)\n4 RSVP\'ed\nWomen Techmakers and Jigsaw are teaming up to create this online safety program for women, which enables communities of ambassadors around the world to organize hackathons with trainings that raise awareness about issues of violence and harassment. faced by women online, which translate into innovative solutions to improve the safety of women online. :\nLog in to RSVP\nAbout this event\nhttps://medium.com/@christelletchouatat/ideathon-wtm-central-africa-30b48d54dbab\nSpeakers\nEsther Fotse\nFounder PlanUGo & KAEFRA\nCEO\nBulanda Nkhowani\nParadigmhq\nProgram Officer for Southern Africa\nMentors\nCHRISTELLE TANKEU\nCode for Africa\nData Analyst & Trainer\nSee Bio\n×\nCHRISTELLE TANKEU\nCode for Africa\nChristelle est une femme passionne par les technologies et l’analyse des donnes. Aprs ses tudes d’Informatique  la Facult des Sciences de l’Universit de Yaound 1.  Elle a enseign l’informatique dans un lyce priv. Vu son intrt pour les technologies, elle a rejoint la communaut GDG Yaound en 2016. tant fortement implique dans les activits organises par Women Techmakers Yaound, elle en est devenue lead. Son implication dans l’engagement des femmes dans les STIM (Science, Technologie, Ingnierie et Mathmatiques) en Afrique Francophone a conduit Google  l’a nomm Mentor Women Techmakers pour l\'Afrique Centrale en 2020.  En 2017, Elle rejoint l’ONG Afroleadership o elle prend part activement aux formations en data journalisme et visualisation des donnes. De mars  septembre 2020, elle fait partie de l’quipe charge d\'assurer la transition numrique des enseignements  la Facult des Sciences de l’Universit de Yaound 1, ceci aprs la fermeture du campus suite  la COVID19.  Elle a suivi en fvrier 2020, une formation chez AIMS-Cameroun en Data science. Aujourd’hui Christelle est Analyste de donnes et  Formatrice chez Code for Africa.\nModerators\nCyprien Tankeu\nUniversity of Yaound 1\nGoogle Workspace Technical Lead\nSee Bio\nRaissa Mandeng\nWtm Douala\nWTM Abassador\nCcilia EKOMY\nP-C\nCEO\nSee Bio\nAnge Taffo\nWTM Ambassador\nWTM Ambassador for Limbe Cameroon\nSee Bio\nCHRISTELLE TANKEU\nCode for Africa\nData Analyst & Trainer\nSee Bio\n×\nCyprien Tankeu\nUniversity of Yaound 1\nCyprien is a computer scientist and GIS specialist. He is currently Google Workspace Technical Manager at the University of Yaound 1. With the Covid-19 crisis, he is supporting the University of Yaound 1 in their digital transformation process and online education. From December 2014 to June 2016, he has the honor to serve as Google Developers Mentor for Francophone Sub-Saharan Africa. During his mission, he worked with Tech Hubs, universities and local developer & startup communities to create and make grow a bigger ecosystem of developers, problem solvers and entrepreneurs of tomorrow.Before that,  He is since December 2011, Analyst at the Ministry of Arts and Culture of Cameroon. And since October 2014, Cyprien is lecturer at the National Advanced School of Posts, Telecommunications and ICT of Yaounde.\n×\nCcilia EKOMY\nP-C\nAuparavent en pleine formation de Comptabilit et Gestion des Organisations, C\'est une jeune femme qui a dcid de se lancer dans la dcouverte du dveloppement.Cette dcouverte n\'a pas seulement t celle du Code mais plutt de toute une philosophie de vie.\n×\nAnge Taffo\nWTM Ambassador\nWTM Ambassador for Limbe Cameroon\n×\nCHRISTELLE TANKEU\nCode for Africa\nChristelle est une femme passionne par les technologies et l’analyse des donnes. Aprs ses tudes d’Informatique  la Facult des Sciences de l’Universit de Yaound 1.  Elle a enseign l’informatique dans un lyce priv. Vu son intrt pour les technologies, elle a rejoint la communaut GDG Yaound en 2016. tant fortement implique dans les activits organises par Women Techmakers Yaound, elle en est devenue lead. Son implication dans l’engagement des femmes dans les STIM (Science, Technologie, Ingnierie et Mathmatiques) en Afrique Francophone a conduit Google  l’a nomm Mentor Women Techmakers pour l\'Afrique Centrale en 2020.  En 2017, Elle rejoint l’ONG Afroleadership o elle prend part activement aux formations en data journalisme et visualisation des donnes. De mars  septembre 2020, elle fait partie de l’quipe charge d\'assurer la transition numrique des enseignements  la Facult des Sciences de l’Universit de Yaound 1, ceci aprs la fermeture du campus suite  la COVID19.  Elle a suivi en fvrier 2020, une formation chez AIMS-Cameroun en Data science. Aujourd’hui Christelle est Analyste de donnes et  Formatrice chez Code for Africa.\nJudges\nCHRISTELLE TANKEU\nCode for Africa\nData Analyst & Trainer\nSee Bio\nEsther Fotse\nFounder PlanUGo & KAEFRA\nCEO\nMinette Lontsie\nAfrika Lyrics\nFonder and CEO\n×\nCHRISTELLE TANKEU\nCode for Africa\nChristelle est une femme passionne par les technologies et l’analyse des donnes. Aprs ses tudes d’Informatique  la Facult des Sciences de l’Universit de Yaound 1.  Elle a enseign l’informatique dans un lyce priv. Vu son intrt pour les technologies, elle a rejoint la communaut GDG Yaound en 2016. tant fortement implique dans les activits organises par Women Techmakers Yaound, elle en est devenue lead. Son implication dans l’engagement des femmes dans les STIM (Science, Technologie, Ingnierie et Mathmatiques) en Afrique Francophone a conduit Google  l’a nomm Mentor Women Techmakers pour l\'Afrique Centrale en 2020.  En 2017, Elle rejoint l’ONG Afroleadership o elle prend part activement aux formations en data journalisme et visualisation des donnes. De mars  septembre 2020, elle fait partie de l’quipe charge d\'assurer la transition numrique des enseignements  la Facult des Sciences de l’Universit de Yaound 1, ceci aprs la fermeture du campus suite  la COVID19.  Elle a suivi en fvrier 2020, une formation chez AIMS-Cameroun en Data science. Aujourd’hui Christelle est Analyste de donnes et  Formatrice chez Code for Africa.\nWhen\nSaturday, Sep 11\n10:00 AM - 4:00 PM (WAT)\nHost\nCHRISTELLE TANKEU\nCode for Africa\nData Analyst & Trainer\nSee Bio\n×\nCHRISTELLE TANKEU\nCode for Africa\nChristelle est une femme passionne par les technologies et l’analyse des donnes. Aprs ses tudes d’Informatique  la Facult des Sciences de l’Universit de Yaound 1.  Elle a enseign l’informatique dans un lyce priv. Vu son intrt pour les technologies, elle a rejoint la communaut GDG Yaound en 2016. tant fortement implique dans les activits organises par Women Techmakers Yaound, elle en est devenue lead. Son implication dans l’engagement des femmes dans les STIM (Science, Technologie, Ingnierie et Mathmatiques) en Afrique Francophone a conduit Google  l’a nomm Mentor Women Techmakers pour l\'Afrique Centrale en 2020.  En 2017, Elle rejoint l’ONG Afroleadership o elle prend part activement aux formations en data journalisme et visualisation des donnes. De mars  septembre 2020, elle fait partie de l’quipe charge d\'assurer la transition numrique des enseignements  la Facult des Sciences de l’Universit de Yaound 1, ceci aprs la fermeture du campus suite  la COVID19.  Elle a suivi en fvrier 2020, une formation chez AIMS-Cameroun en Data science. Aujourd’hui Christelle est Analyste de donnes et  Formatrice chez Code for Africa.\nOrganizers\nCyprien Tankeu\nUniversity of Yaounde I\nGDG Organizer\nView Profile\nMelanie L.\nGDG Organizer\nView Profile\nAurelien Xavier Payong\nBlazr LLC\nGDG Organizer\nView Profile\nYves Bakota\nAdvance IT Group\nGDG Organizer\nView Profile\nChristelle Tchouatat\nGDG Organizer\nView Profile\nIngrid Koumi\nWTM Yaound Ambassador\nView Profile\n×\n×\n×\n×\n×\n×\nContact Us\nContact Us\nSend\nMessage Sent!\nYour message has been successfully sent.\nOK','2020-02-01 00:00:00','2021-09-11 15:00:00',NULL,NULL,'online',NULL,NULL,0,0,'JPY','2827523400','#WTM_Dla Ambassador ngo mandeng raisnick','MaRainick',0,0,'2021-09-11 04:50:14','2021-09-11 04:50:14',7,0,NULL);
INSERT INTO `events` (`id`, `event_id`, `type`, `title`, `url`, `shortener_url`, `description`, `started_at`, `ended_at`, `limit_number`, `address`, `place`, `lat`, `lon`, `cost`, `max_prize`, `currency_unit`, `owner_id`, `owner_nickname`, `owner_name`, `attend_number`, `substitute_number`, `created_at`, `updated_at`, `informed_from`, `state`, `og_image_info`) VALUES (650485,'1436389378696388610','HackathonEvent','GameJam Føroya 2021','https://itch.io/jam/gamejam-foroya-2021',NULL,'Browse GamesGame JamsUpload GameDeveloper LogsCommunity\nLog inRegister\nIndie game storeFree gamesFun gamesHorror games\nGame developmentAssetsComics\nSalesBundles\nJobs\nGameJam Froya 2021\nHosted by GameJam Froyar  #gamejamForoyar2021\n2\nJoined\n0\nEntries\nOverview\nSubmissions open from 2021-09-10 18:00:00 to 2021-09-12 18:10:00\nSubmissions due in\nyears\nmonths\ndays\nhours\nminutes\nseconds\nJoin jam\nVlkomin!\nHetta er ta rliga froyska GameJam - sum n verur strt av GameJam Froya\nTit kunnu finna okkum  Facebook og Instagram!\nUm tit vilja fylgja vi hvussu ta gongur hj flki, so vimla vit at t kemur inn Discordkanalina - har ta verur stula undir at luttakarir leggja status myndir og video t!\nStevnan er Klintra r (vi avmarka plss), men ll eru vlkomin at vera vi online!\nReglar!\nTit fa 48 tmar at menna tykkara spl. Ikki meira og ikki minni\nSpli skal  onkran htt vera kntt at evninum\nSpli skal ikki vera ov hskandi av natr\nCopyright tilfar  splinum skal vera  ordan (onki stoli tilfar) 5. Hugni tykkum!\nAvlevera spli!\nFyri at orduliga vera vi til GameJam Froya 2021, vilja vit heita teg  at tit senda spli hj tykkum - sum blkur -inn  her renn deadline.\nTit kunnu gott gera eina submission beinanvegin, og so dagfra tykkara submission t i ta er klrt at leggja spli t :)\nUm tit gera eitt spl til teldu, so er best um tit kunnu leggja t eina windows versin. (T tey flestu brka windows).\nTa er fornuftigt at tit byrja at upload\'a spli eitt sindur renn,  fall ta tekur eina ga ltu. T ta m vera upload\'a renn kl. 19:10\nHer er ein vegleiing um hvussu man upload\'ar spli til GameJam Froya 2021','2021-09-10 18:00:00','2021-09-12 19:10:00',NULL,NULL,'online',NULL,NULL,0,0,'JPY','2222297833','Indie Game Jams','IndieGameJams',0,0,'2021-09-11 04:50:20','2021-09-11 10:10:03',10,0,'{\"image_url\":\"https://img.itch.zone/aW1nLzY5NDE3MjMuanBlZw==/original/iqq8nU.jpeg\",\"width\":2048,\"height\":1069,\"type\":\"jpeg\"}');
INSERT INTO `events` (`id`, `event_id`, `type`, `title`, `url`, `shortener_url`, `description`, `started_at`, `ended_at`, `limit_number`, `address`, `place`, `lat`, `lon`, `cost`, `max_prize`, `currency_unit`, `owner_id`, `owner_nickname`, `owner_name`, `attend_number`, `substitute_number`, `created_at`, `updated_at`, `informed_from`, `state`, `og_image_info`) VALUES (650506,'127203','DevelopmentCampEvent','資源起点アイデアの作り方','https://swkanmon.doorkeeper.jp/events/127203','https://bit.ly/3nr3gXK','<p>・自分が出来ることからアイデアを作りたい<br>\n・資源の強みに着目して事業を考えてみたい<br>\n・今、ここから始められる可能性を掴みたい</p>\n\n<p> そんな想いをお持ちの皆様に向け<strong>資源起点のアイデア発想法を実践形式で学ぶ機会</strong>をオンライン(Zoom)にてお届けさせていただきます。本来は二日間に亘って新規事業開発を行うプログラムではあるものの、その全体像を圧縮しエッセンスのみを共有いたします。</p>\n\n<h2 style=\"background-color:#efefef; border-left:solid 3px; padding:10px\">資源起点のアイデア発想法とは?</h2>\n\n<p>  顧客の課題や痛みを起点にするのではなく、また自身の愛や願いを起点にするのでもなく、自身が有する資源から新しい価値を探求するアプローチです。もちろん資源単体では世に通ずるものは中々に生み出せないため、資源を分析してふるいにかけた後、仲間との価値の連結を通じてアイデアの考案を進めます。</p>\n\n<hr>\n\n<p><img src=\"https://swkanmon.doorkeeper.jp/files/ad166ce74a70fad77e86b6bb1e8f74d7025c9cc7/shigen.jpg\" alt=\"shigen.jpg\"></p>\n\n<p><strong>①資源の棚卸</strong><br>\n自身が持つ資源を発見します。</p>\n\n<p><strong>②価値の分析</strong><br>\n資源を分析し強みを見出します。</p>\n\n<p><strong>③価値の連結</strong><br>\n掛け合わせから価値を創造します。</p>\n\n<p><strong>④起点の創造</strong><br>\n制限された始まりの一手を作ります。</p>\n\n<p><strong>⑤対話と学習</strong><br>\n想定する顧客と向き合い学びを得ます。</p>\n\n<p>※上記プロセスは一例です。</p>\n\n<hr>\n\n<p>・自分が出来ることから事業を始めたい<br>\n・新規事業を考える方法論を増やしたい<br>\n・自身が持つ可能性を客観的に知りたい</p>\n\n<p>そんな想いをお持ちの皆様は、是非に本会をご活用いただければ幸いです。</p>\n\n<h2 style=\"background-color:#efefef; border-left:solid 3px; padding:10px\">ファシリテーター  Facilitator </h2>\n\n<h3>中本 卓利(Nakamoto Takuto)</h3>\n\n<p>特定非営利活動法人StartupWeekend 理事<br>\n一般社団法人ベンチャー型事業承継 エヴァンジェリスト<br>\n<a href=\"http://www.facebook.com/takuto.nakamoto\" rel=\"nofollow\"><br>\n<img src=\"https://swshirahama.doorkeeper.jp/files/20545432f77f2890e0e315e6756ebfd9f52163f0/takuto.jpg\" alt=\"takuto.jpg\"><br>\n</a><br>\n  神戸大学発達科学部卒業後、起業家のためのコワーキングスペース運営やインキュベーション施設のディレクターを経てStartupWeekendに参画。短期間でアイデアを検証するプロとして北海道から沖縄まで事業立ち上げ支援やクラウドファンディング指南を手掛けている。加え全国にて承継予定の家業を持つ若手アトツギの皆様に向け、先代から受け継いだ経営資源を活用した新規事業開発講座や時代に合わせた事業転換支援を行っている。和歌山県出身。</p>\n\n<h2 style=\"background-color:#efefef; border-left:solid 3px; padding:10px\">備考</h2>\n\n<p>本イベントは三泊付の合宿形式のプログラム「StartupWeekend関門」のプレイベントとなります。詳細につきましては下記画像をクリックの上、ご参考ください。<br>\n<a href=\"https://swkanmon.doorkeeper.jp/events/123020\"><br>\n<img src=\"https://swkanmon.doorkeeper.jp/files/9cbe02a29f158a21b7239a3f66a64fdfef49d3cc/kanmon.jpg\" alt=\"kanmon.jpg\"><br>\n</a></p>\n\n<h2 style=\"background-color:#efefef; border-left:solid 3px; padding:10px\">StartupWeekend</h2>\n\n<p>Startup Weekendは、週末の3日間を利用してアイデアを形にするための方法論を学ぶ、スタートアップ体験イベントです。このワークショップは2009年に米国で始まり、これまで1,800都市で7,000回以上にわたって実施されてきました。Startup Weekendは初日の夜、参加者のアイデアの発表から始まります。そしてチームを組み三日目の夕方までに必要最小限のビジネスモデルを一気に作り上げます。</p>\n\n<p><img src=\"https://swnagoya.doorkeeper.jp/files/a6cd968d2c3694d9a9e411b1a378a6fced167bae/gsb.jpg\" alt=\"gsb.jpg\"></p>\n\n<h2 style=\"background-color:#efefef; border-left:solid 3px; padding:10px\">スポンサー</h2>\n\n<p>開催にあたり、以下のスポンサー様からご支援をいただいております。</p>\n\n<p><b>弥生株式会社 様</b><br>\n<a href=\"https://www.yayoi-kk.co.jp/\" rel=\"nofollow\"><br>\n<img src=\"https://swkitakyusyu.doorkeeper.jp/files/da8481af85d02ab06c075d18c519e865ca04d7d2/yayoi.jpg\" alt=\"yayoi.jpg\"><br>\n</a></p>','2021-09-26 01:00:00','2021-09-26 03:30:00',10,NULL,'',NULL,NULL,0,0,'JPY','10298',NULL,NULL,14,4,'2021-09-12 04:06:51','2021-09-12 10:09:17',3,0,'{\"image_url\":\"https://dzpp79ucibp5a.cloudfront.net/rails/active_storage/representations/proxy/eyJfcmFpbHMiOnsibWVzc2FnZSI6IkJBaHBBM01MQkE9PSIsImV4cCI6bnVsbCwicHVyIjoiYmxvYl9pZCJ9fQ==--4cecce248643cb05f164761006c8cfa638c01bea/eyJfcmFpbHMiOnsibWVzc2FnZSI6IkJBaDdCem9MWm05eWJXRjBTU0lJYW5CbkJqb0dSVlE2RkhKbGMybDZaVjkwYjE5c2FXMXBkRnNIYVFMb0F6QT0iLCJleHAiOm51bGwsInB1ciI6InZhcmlhdGlvbiJ9fQ==--8ce6569ce3b1f779d3cfcdbb6038d926ad4475c7/shigen_kiten_head.jpg\",\"width\":820,\"height\":358,\"type\":\"jpeg\"}');
INSERT INTO `events` (`id`, `event_id`, `type`, `title`, `url`, `shortener_url`, `description`, `started_at`, `ended_at`, `limit_number`, `address`, `place`, `lat`, `lon`, `cost`, `max_prize`, `currency_unit`, `owner_id`, `owner_nickname`, `owner_name`, `attend_number`, `substitute_number`, `created_at`, `updated_at`, `informed_from`, `state`, `og_image_info`) VALUES (650507,'224868','DevelopmentCampEvent','第38回 ひろしまPCNオンラインこどもプログラミング教室','https://pcn-hiroshima.connpass.com/event/224868/','https://bit.ly/391oLG4','<h3>コロナ対策につきまして</h3>\n<p>【リモート開催について】<br>\n・今回はリモート開催のみとさせていただきます<br>\n・リモート開催には「ZOOM」を活用させていただきます<br>\n・今回は経験者枠のみの募集とさせていただきます。何卒ご了承ください<br>\n・申込いただいた方へ個別に当日の接続先URL等をお知らせさせていただきます</p>\n<h3>お申し込みについて</h3>\n<ul>\n<li>小・中学生の方は親子ペアで参加することも出来ます。 </li>\n<li>参加費は無料です。</li>\n<li>経験者枠はご自分で機材(IchigoJam本体・キーボード・モニタ)を持参いただける方を想定しています。  </li>\n<li>経験者枠は当日に参加される方々と講師でクラブ活動的にやりたい事を一緒にお話しながら進める予定です。  </li>\n<li>申込時に質問のある方は代表のイシザキまでご連絡ください。(kou06ishi16@gmail.com)</li>\n</ul>\n<h3>タイムスケジュール</h3>\n<p>10:20  リモート受付開始<br>\n ZOOMでの接続テスト等を行わせていただきます。<br>\n10:30  プログラミング教室開始<br>\n10:30  10:40 PCNひろしまの活動紹介<br>\n10:40  教室スタート</p>\n<p>&lt;経験者枠のながれ&gt;<br>\n・当日に講師と参加者でやりたい事を一緒にお話しながら進めていきます。<br>\n・ 11:45頃から合同で共有する場を持ちたいと思います。  </p>\n<p>11:45  みんなでやったこと共有<br>\n12:00  会場撤収     </p>\n<h3>ペアでプログラミング体験</h3>\n<p>小・中学生で希望する方は親子1組のペアでプログラミング体験も可能です。<br>\n親子で相談したり確認したりしながら「IchigoJam」のパソコン操作を行うことで、<br>\n体験の様子は「<a href=\"https://youtu.be/D6W7yM1wU7Q\" rel=\"nofollow\">コチラ</a>」</p>','2021-09-26 01:30:00','2021-09-26 03:30:00',9,'オンライン','Zoom',NULL,NULL,0,0,'JPY','9645','koutarou_ishizaki','koutarou_ishizaki',1,0,'2021-09-12 04:06:52','2021-09-12 10:09:19',1,0,'{\"image_url\":\"https://connpass-tokyo.s3.amazonaws.com/thumbs/f1/9f/f19f1e9f78bcebaf7489727f98f22c31.png\",\"width\":468,\"height\":268,\"type\":\"png\"}');
