INSERT INTO `events` (`id`, `event_id`, `type`, `title`, `url`, `shortener_url`, `description`, `started_at`, `ended_at`, `limit_number`, `address`, `place`, `lat`, `lon`, `cost`, `max_prize`, `currency_unit`, `owner_id`, `owner_nickname`, `owner_name`, `attend_number`, `substitute_number`, `created_at`, `updated_at`, `informed_from`, `state`, `og_image_info`) VALUES (650575,'224849','DevelopmentCampEvent','【オンライン】GR-ROSE  IoTシステム開発コンテスト  作品LT大会＆審査会！','https://algyan.connpass.com/event/224849/','https://bit.ly/2YPcXVz','<p><font color=\"blue\" size=\"5\"><b>【オンライン】GR-ROSE  IoTシステム開発コンテスト \n作品LT大会&審査会!\n</b></font><br>\n<font color=\"green\" size=\"4\"><b>あの「GR-ROSE」を使ってオリジナルIoT作品を作ってみた!</b></font><br>\n<br>\n<font color=\"orange\" size=\"3\"><b>オンラインイベントですので、日本全国どこからでもご参加出来ます。</b></font><br>\n<br></p>\n<p><br>\n<font color=\"green\" size=\"3\">皆さん、ご自分でIoTシステムを開発したことはありますか?</font><br>\n<font size=\"3\">今回、ルネサスエレクトロニクス株式会社様の全面的なご協力のもと、<br>\n「がじぇっとるねさすプロジェクト <a href=\"https://www.renesas.com/jp/ja/products/gadget-renesas\" rel=\"nofollow\">https://www.renesas.com/jp/ja/products/gadget-renesas</a> 」のIoT Edgeデバイス</font><font color=\"red\" size=\"3\">「GR-ROSE(ジーアール・ローズ)」と周辺部材をどんとご提供頂き、コンテストを開催する運びとなりました!</font><br>\n<font color=\"green\" size=\"3\">なんと太っ腹なルネサスエレクトロニクス株式会社様!\nみなさん拍手!ぱちぱちぱち!</font><br>\n<br>\n<font size=\"3\">GR-ROSEは、32ビットマイコンRX65Nを搭載。<br>\nArduino, ROS2, AWS FreeRTOSを使ったアプリケーションに最適で、ロボットやIoTのプロトタイピング用小型ボードです。<br>\n公式ページはこちら↓↓↓↓↓<br>\n<a href=\"https://www.renesas.com/jp/ja/products/gadget-renesas/boards/gr-rose\" rel=\"nofollow\">https://www.renesas.com/jp/ja/products/gadget-renesas/boards/gr-rose</a> <br>\n<br>\n<font color=\"blue\" size=\"4\"><b>当イベントは、熱く尊いチャレンジ精神を持った挑戦者たちが創り上げた作品群の発表審査会です!!!!!</b></font><br>\n<font color=\"red\" size=\"4\"><b>果たして、どんなIoT作品が作られたのでしょうか!</b></font><br></font></p><font size=\"3\">\n<p><br>\n<font color=\"red\" size=\"3\">どうですか、わくわくするでしょう!</font><br>\n魅力的なIoT プロトタイピングがすぐに出来そうな気がしませんか!<br>\n<br>\n<font color=\"blue\" size=\"3\"><b>これを機に、IoTプロトタイピングの世界に飛び込みましょう!</b></font><br></p>\n</font><p><font size=\"3\"><br>\n<br>\nALGYANが初めての方も大歓迎です。<br>\nこれを機にみんなで集合知を結集しながら、一緒にテクノロジーの「今」と「未来」に熱い思いを馳せましょう!<br>\n<br>\nDon’t sleep through life!<br>\n<font color=\"green\">ぼーっと生きてんじゃねえよ!</font><br>\n<br>\nIoT ALGYAN(あるじゃん)理事長 小暮敦彦<br></font>\n<br>\n<font color=\"orange\"><b>動作中のGR-ROSE</b></font><b><br>\n<img alt=\"画像\" src=\"https://techmode.co.jp/images/GR-ROSE_2.png\"><br>\n<font color=\"orange\"><b>Azureでの可視化</b></font><b><br>\n<img alt=\"画像\" src=\"https://techmode.co.jp/images/GR-ROSE_3.png\"><br>\n<br>\n<br></b></b></p><b><b>\n<h1><strong><font color=\"green\">【参加枠について解説】</font></strong></h1>\n<p>参加枠について解説します。<br></p>\n<p><font color=\"blue\" size=\"3\">【LT枠・コンテスト応募枠】 </font><br>\nGR-ROSE+Azureを使ってIoTシステムのアイデアを具現化した勇者達専用です。<br>\n可能な限り早めにエントリーしてください。<br>\n講演タイトルは仮で結構です。<br>\n<br>\n<br>\n<font color=\"blue\" size=\"3\">【見学枠】 </font> <br>\n「何もしないでぼーっと見ていたい」かた向けです。<br>\nお気軽にどうぞ。<br>\n<br></p>\n<p><br>\n<br></p>\n<h1><strong><font color=\"green\">【スケジュール】 </font></strong></h1>\n<p><b><font color=\"red\" size=\"3\">・2021/9/11(土)</font><font color=\"blue\" size=\"3\">meet up!(オンライン)</font></b><br>\n オンラインで使用法の体感をして頂きました。<br></p>\n<p><b><font color=\"red\" size=\"3\">・2020/10/31(日)</font><font color=\"blue\" size=\"3\">コンテスト審査発表会LTエントリー期限</font></b><br>\n→プレゼント品のGR-ROSEを受け取ったかたは、原則として全員エントリーして下さい(泥棒禁止!)。<br>\n<b><font color=\"red\" size=\"3\">・2021/11/13(土)</font><font color=\"blue\" size=\"3\">コンテスト審査発表会本番!優秀賞選出</font></b><b><font color=\"orange\" size=\"3\">※本イベント</font></b><br>\n →全員もしくは選ばれたファイナリストがLT!その場で優秀賞を決定!<br>\n →オンライン開催を予定しています。<br>\n →優秀者は栄誉ある素敵な賞品がもらえます!<br>\n →<font color=\"red\" size=\"4\"> 11/13の審査会優秀者には栄誉ある賞品をプレゼント!</font><br>\n  ①Amazonギフト券 (総額40,000円相当)<br>\n  <br>\n  ②RX65N Cloud Kit (約1万円相当)<br>\n  <a href=\"https://www.renesas.com/jp/ja/products/microcontrollers-microprocessors/rx-32-bit-performance-efficiency-mcus/rx65n-cloud-kit-renesas-rx65n-cloud-kit<br>\" rel=\"nofollow\">https://www.renesas.com/jp/ja/products/microcontrollers-microprocessors/rx-32-bit-performance-efficiency-mcus/rx65n-cloud-kit-renesas-rx65n-cloud-kit<br></a></p>\n<p>③近藤科学 KXR-A3S 3軸アーム型(GR-ROSE付属版)<br>\n  <a href=\"https://kondo-robot.com/product/03192<br>\" rel=\"nofollow\">https://kondo-robot.com/product/03192<br></a></p>\n<p><br>\n<br></p>\n<h1><strong><font color=\"green\">【11/13のコンテスト審査発表会出品条件につきまして】 </font></strong></h1>\n</b><p><b>・プレゼント品(もしくは持ち込み)のGR-ROSEと、Azureのなんらかの機能を使って、IoT作品に仕立てて下さい(ご自分で部品や機材を追加するのは勿論自由です)。スタンドアロンで動いてもそれはIoTじゃないですよねっ。<br>\n これだけが条件です!<br>\n あとは皆さんの創意工夫次第!<br>\n<br>\n・<font color=\"blue\" size=\"3\">2021/10/31(日)コンテスト審査発表会LTエントリー期限</font></b><br>\n→この日までに最終作品を仕上げ、LT専用応募フォームに入力を済ませること!<br>\n→原則として全員エントリーして下さい(泥棒禁止!)。<br></p>\n<h1><strong><font color=\"green\">【参加条件】</font></strong></h1>\n<p>・ALGYANメンバーであること(本イベント参加と同時に自動的にメンバーになっています)。<br>\n・当コミュニティやイベントの趣旨を理解し、運営ボランティアメンバーや協賛企業様の貢献を<font color=\"red\">寛容な気持ちで温かく応援</font>してくださるあなたなら、どなたでもご参加出来ます!<br>\n→ALGYANのイベントへのご参加は、connpassグループのメンバーになることが最低条件です。<br>\n connpassグループ(必須)→ <a href=\"https://algyan.connpass.com\" rel=\"nofollow\">https://algyan.connpass.com</a> <br>\n ALGYAN本会FBグループ(強く推奨)→ <a href=\"https://www.facebook.com/groups/ioytjp/\" rel=\"nofollow\">https://www.facebook.com/groups/ioytjp/</a> <br>\n (ALGYANグループのメンバーには、固定会費負担や何らかの義務負担などは一切ありませんのでご安心ください)<br>\n<br>\n<font color=\"orange\">どうか寛容な気持ちを持って、運営メンバーや講師を<font color=\"red\">温かく応援</font>する気持ちでご参加ください。<br>\n参加者の皆さんは<font color=\"red\">「お客様」ではありません。</font><br>\n参加者の皆さんも、言わば運営スタッフの一員です。<br>\n運営ボランティア・講師・協力協賛企業と<font color=\"red\">一緒になって、より良いイベントを作り上げる</font>というスピリッツをお持ちください。<br>\nそして、他の知らない参加者ともお互いに教え合うような、<font color=\"red\">和気藹々とした雰囲気で</font>進めましょう!<br>\n(SNS投稿やツイートによる心無い「荒らし」行為はご遠慮ください。)<br></font>\n<br>\n<br>\n<br></p>\n<h1><strong><font color=\"green\">【必要な準備について】</font></strong></h1>\n<p>今回はハンズオンではないので特に開発環境などは不要です。<br>\n<br>\n<b><font color=\"blue\">【ライブ接続環境】</font><br>\nLT登壇者は必ずTeamsで接続し、開催前の画面共有テストに参加してください(当日13:00から待機しています)。<br>\n<br>\n見学枠のかたはお好みで、<font color=\"red\"><b> YouTubeライブ</b></font><b>もしくは<font color=\"red\"> Microsoft Teams</font>にて接続出来るよう、ご準備ください。<br>\nTeamsの場合は、<font color=\"blue\">下段の【Teams事前準備について】を参照し、必要な設定を済ませておいてください。</font></b><br>\n<font color=\"red\">それぞれの接続 URLは、参加登録者にのみ、当イベントページ上部に表示されます。</font><br>\n<br>\nコメントは「Tweetで」お気軽につぶやいてください!<br>\n  #ALGYAN<br>\n<br>\n・一緒に楽しむ優しい気持ち。<br>\n・熱い情熱。<br>\n<br></b></p><b>\n<h1><font color=\"green\"><b>【Teams事前準備について】</b></font><br></h1>\n<p><b>Microsoft Teamsアプリをインストール済みのかたは準備は不要です。<br>\nMicrosoft Teamsアプリをインストールして「いない」かたも、次の2つの手軽な接続方法があります。</b><br>\n①【ブラウザのみで参加する方法】<br>\n②【無料版のTeamsに登録する方法】<br>\n<br>\n<font color=\"blue\"><b><やり方①【ブラウザのみで参加する方法】></b></font><br>\n・開催時刻になったら、事前にお知らせするTeams URLを開きます。<br>\n<font color=\"red\">(当日のTeams URLは、参加登録者にconnpassのメール配信機能にてお知らせします。)</font><br>\n<br>\n・「代わりにWeb上で参加」をクリック<br>\n<img alt=\"画像\" src=\"https://techmode.co.jp/images/teams_4.png\"><br>\n<br>\n・「名前を入力」欄に、名前を入力して、「今すぐ参加」をクリック<br>\n<img alt=\"画像\" src=\"https://techmode.co.jp/images/teams_5.png\"><br>\n<br>\n<br>\n<br>\n<font color=\"blue\"><b><やり方②【無料版のTeamsに登録する方法】></b></font><br>\n・下記URLを開き、ページ下部までスクロールします。<br>\n<a href=\"https://products.office.com/ja-jp/microsoft-teams/group-chat-software/\" rel=\"nofollow\">https://products.office.com/ja-jp/microsoft-teams/group-chat-software/</a> <br>\n<br>\n・「無料でサインアップ」をクリック\n<img alt=\"画像\" src=\"https://techmode.co.jp/images/teams.png\"><br></p>\n<p>下記URLに登録の手順がありますので、こちらにならって登録して下さい。<br>\n<a href=\"https://support.microsoft.com/ja-jp/office/70aaf044-b872-4c32-ac47-362ab29ebbb1\" rel=\"nofollow\">https://support.microsoft.com/ja-jp/office/70aaf044-b872-4c32-ac47-362ab29ebbb1</a> <br>\n<br>\n<br>\n<font color=\"red\">当日のTeams URLは、参加登録者にのみ、当イベントページ上部に表示されます。</font><br>\n<br>\n<br><br></p>\n<h1><strong><font color=\"green\">【参加費】</font></strong></h1>\n<p>・<font color=\"red\"><b>無料</b></font><br>\n →アルコールおつまみ等どうぞ各自勝手にお手元にご用意ください(当然ですが自己負担です)。<br> \n Azure関連費用・通信費などは自己責任で管理をお願いします。<br>\n<br></p>\n<h1><strong><font color=\"green\">【参加条件】</font></strong></h1>\n<p>・当コミュニティやイベントの趣旨を理解し、運営ボランティアメンバーや協賛企業様の貢献を<font color=\"red\">寛容な気持ちで温かく応援</font>してくださるあなたなら、どなたでもご参加出来ます!<br>\n→ALGYANのイベントへのご参加は、connpassグループのメンバーになることが最低条件です。<br>\n connpassグループ(必須)→ <a href=\"https://algyan.connpass.com\" rel=\"nofollow\">https://algyan.connpass.com</a> <br>\n ALGYAN本会FBグループ(強く推奨)→ <a href=\"https://www.facebook.com/groups/ioytjp/\" rel=\"nofollow\">https://www.facebook.com/groups/ioytjp/</a> <br>\n (ALGYANグループのメンバーには、固定会費負担や何らかの義務負担などは一切ありませんのでご安心ください)<br>\n<br>\n<font color=\"orange\">どうか寛容な気持ちを持って、運営メンバーや講師を<font color=\"red\">温かく応援</font>する気持ちでご参加ください。<br>\n参加者の皆さんは<font color=\"red\">「お客様」ではありません。</font><br>\n参加者の皆さんも、言わば運営スタッフの一員です。<br>\n運営ボランティア・講師・協力協賛企業と<font color=\"red\">一緒になって、より良いイベントを作り上げる</font>というスピリッツをお持ちください。<br>\nそして、他の知らない参加者ともお互いに教え合うような、<font color=\"red\">和気藹々とした雰囲気で</font>進めましょう!<br>\n(SNS投稿やツイートによる心無い「荒らし」行為はご遠慮ください。)<br></font>\n<br></p>\n<p><br></p>\n<h1><strong><font color=\"green\">【開催場所】</font></strong></h1>\n<p><font color=\"blue\" size=\"2\"><b>地球</b></font><br>\nあなたのいる場所が開催地です。<br>\n<br>\n<br></p>\n<p><br></p>\n<p><br>\n<br></p>\n<h1><strong><font color=\"green\">【審査員】</font>(敬称略)</strong></h1>\n<h2><font size=\"4\"><b>岡宮 由樹</b></font></h2>\n<p><img src=\"https://techmode.co.jp/images/okamiya.jpg\" width=\"40%\"><br>\nルネサスエレクトロニクス システムソリューションチーム 主任<br>\nがじぇるねの立役者!<br></p>\n<p><br></p>\n<h2><font size=\"4\"><b>太田 寛</b></font></h2>\n<p><img src=\"https://techmode.co.jp/images/20200920ota.jpg\" width=\"40%\"><br>\nマイクロソフトコーポレーション  WCB CSU IoT シニア IoT テクニカルスペシャリスト<br>\n<br>\n<br></p>\n<h2><font size=\"4\"><b>小暮 敦彦</b></font></h2>\n<p><img src=\"https://techmode.co.jp/images/kogure.jpg\" width=\"40%\"><br>\nIoT ALGYAN理事長<br>\n「がじぇるね」の仕掛け人。<br>\nピンク色のレジストの発明者。<br>\n基本的に裏方。知らない人は本当に知らない。<br><br><br><br><br><br><br><br><br>\n<br></p>\n<h1><strong><font color=\"green\">【タイムテーブル】</font></strong></h1>\n<table>\n<thead>\n<tr>\n<th align=\"left\">  時  刻</th>\n<th align=\"left\">進行内容( 2021年11月13日 ) 敬称略</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td align=\"left\"><font color=\"red\">14:00</font><br><b></b></td>\n<td align=\"left\"><b><font color=\"green\">開始</font> (司会:IoT ALGYAN理事長 小暮)開演ご挨拶と注意点</b><br><br><br>随時更新!<br><font color=\"green\"><b>沢山の素敵な作品群のLTを見れます!<br><br><br><br><br><br> </b></font></td>\n</tr>\n<tr>\n<td align=\"left\"><font color=\"red\">17:00   </font><br></td>\n<td align=\"left\"><font color=\"green\">終了予定(主催者が眠くなり次第)</font><br></td>\n</tr>\n</tbody>\n</table>\n<p>※記載時刻は進行の目安を講演者と共有する目的で示しているものであり、確約するものではありません。<br>\n スケジュールは前後するのが前提とお考えください。<br>\n 記載の終了時刻をあてにして予定を組まないようにしてください。<br>\n 従って、タイムテーブルや記載時刻の誤差に関するクレームを投稿なさることはお控えください。<br>\n<br>\n※イベント終了後も運営メンバーの内輪の呑み(雑談)が続いていることがあります。<br>\n 視聴して構いませんが、オフレコトークなので口外しないよう、自己責任でご参加ください。<br>\n<br></p>\n<h1><strong><font color=\"green\">【GitHub】</font></strong></h1>\n<p><a href=\"https://github.com/algyan/\" rel=\"nofollow\">https://github.com/algyan/</a> <br></p>\n<p><br></p>\n<h1><strong><font color=\"green\">【Twitterでつぶやきましょう!】</font></strong></h1>\n<p>ハッシュタグ <font color=\"DeepSkyBlue\" size=\"3\">#ALGYAN </font></p>\n<p><a href=\"https://twitter.com/intent/tweet?hashtags=ALGYAN\" rel=\"nofollow\">https://twitter.com/intent/tweet?hashtags=ALGYAN</a></p>\n<p><br></p>\n<h1><strong><font color=\"green\">【注意事項】</font></strong></h1>\n<p>※運営スタッフは全員ボランティアです。速やかな進行にご協力ください。<br>\n※メディアの取材記事や当コミュニティのFacebookグループページや告知ページ、Twitterツイート、ご参加者のブログなどに顔等が写りこんでしまう可能性があります。あらかじめご了承ください。<br>\n<br>\n<font color=\"orange\">どうか寛容な気持ちを持って、運営メンバーや講師を<font color=\"red\">温かく応援</font>する気持ちでご参加ください。<br>\n参加者の皆さんは<font color=\"red\">「お客様」ではありません。</font><br>\n参加者の皆さんも、言わば運営スタッフの一員です。<br>\n運営ボランティア・講師・協力協賛企業と<font color=\"red\">一緒になって、より良いイベントを作り上げる</font>というスピリッツをお持ちください。<br>\nそして、他の知らない参加者ともお互いに教え合うような、<font color=\"red\">和気藹々とした雰囲気で</font>進めましょう!<br>\n(SNS投稿やツイートによる心無い「荒らし」行為はご遠慮ください。)<br></font>\n<br>\n<br>\n録画についてご協力のお願い<br>\n・本イベントはteamsの録画機能を使って録画します。録画した動画は、SNS等にアップすることがあります。顔や背景等写りこむ可能性がありますのであらかじめご了承ください。<br>\n・講演中マイクをONにしていると雑音や周辺ノイズが入ってしまいます。講演の妨げにならぬよう、講演者以外はマイクをミュートしていただきますようお願いします。<br>\n<br>\n参加者の皆様にはご自身のプライバシーに配慮いただくとともに、スムーズな進行にご協力のほどよろしくお願いします。<br>\n講演終了後に行うオンライン懇親会は録画しませんので、講演者や参加者同士で気軽に技術談義を楽しみましょう!<br>\n<br></p>\n<h1><strong><font color=\"green\">【個人情報の扱いについて】</font></strong></h1>\n<p>個人情報は関係法令に従って管理いたします。他の用途では使いません。<br>\n<br>\n<br></p>\n<h1><strong><font color=\"green\">【主催・協賛・協力(敬称略)】</font></strong></h1>\n<p>主催: IoT ALGYAN(あるじゃん)運営委員会 <a href=\"https://algyan.connpass.com\" rel=\"nofollow\">https://algyan.connpass.com</a> <br>\n共催:ルネサスエレクトロニクス株式会社 <a href=\"https://www.renesas.com/jp/ja/products/gadget-renesas\" rel=\"nofollow\">https://www.renesas.com/jp/ja/products/gadget-renesas</a> <br>\n協賛・協力:<br>\n 日本マイクロソフト株式会社 <a href=\"https://www.microsoft.com/ja-jp\" rel=\"nofollow\">https://www.microsoft.com/ja-jp</a> <br>\n 近藤科学株式会社 <a href=\"https://kondo-robot.com\" rel=\"nofollow\">https://kondo-robot.com</a> <br>\n 株式会社テクモード  <a href=\"https://techmode.co.jp\" rel=\"nofollow\">https://techmode.co.jp</a> <br>\n 全国あるじゃん有志の皆さん<br>\n 当日参加者してくださる、あ・な・た!<br>\n<br></p>\n<h1><strong><font color=\"green\">【YouTubeチャンネル登録のお願い!!!】</font></strong></h1>\n<p><a href=\"https://www.youtube.com/c/ALGYAN\" rel=\"nofollow\">https://www.youtube.com/c/ALGYAN</a> <br></p>\n<p>IoT ALGYANが持つ「本物の技術」をYouTubeでも発信していきます!<br>\nコンテンツは少しずつ追加していきます。<br>\nみなさん何も考えずに<font color=\"red\" size=\"3\">【チャンネル登録】</font>をお願いいたします!!!<br>\n<br></p>\n<h1><strong><font color=\"green\">【ご支援(カンパ・ご協賛)のお願い】</font></strong></h1>\n<p>皆さまの温かいご支援をお待ちしています。<br>\n継続的な運営のために大切に活用させていただきます。<br>\n<a href=\"https://www.algyan.net/Donation.html\" rel=\"nofollow\">https://www.algyan.net/Donation.html</a></p>\n<p><br></p></b></b>','2021-11-13 05:00:00','2021-11-13 08:00:00',NULL,'オンライン','地球',30.2104,-92.0316,0,0,'JPY','45097','AtsuhikoKogure','A.kogure',8,0,'2021-09-12 04:50:25','2021-09-12 10:09:26',1,0,'{\"image_url\":\"https://connpass-tokyo.s3.amazonaws.com/thumbs/14/cf/14cffe51a30143a56bd1f3a3505f344c.png\",\"width\":468,\"height\":235,\"type\":\"png\"}');
INSERT INTO `events` (`id`, `event_id`, `type`, `title`, `url`, `shortener_url`, `description`, `started_at`, `ended_at`, `limit_number`, `address`, `place`, `lat`, `lon`, `cost`, `max_prize`, `currency_unit`, `owner_id`, `owner_nickname`, `owner_name`, `attend_number`, `substitute_number`, `created_at`, `updated_at`, `informed_from`, `state`, `og_image_info`) VALUES (650576,'1436865047846789120','HackathonEvent','静岡県／アイデアソンとハッカソン～オープンデータの利活用～vol.2','https://www.pref.shizuoka.jp/kikaku/d_talk/20210702.html',NULL,'JavaScriptが無効なため一部の機能が動作しません。動作させるためにはJavaScriptを有効にしてください。またはブラウザの機能をご利用ください。\n本文へスキップします。\n検索の仕方\nホーム > 県政情報 > 県政総合 > ようこそ部局長室へ > デジタル戦略担当部長 > アイデアソンとハッカソン~オープンデータの利活用~vol.2\nデジタル戦略担当部長\nデジタル戦略担当部長室【トーク一覧】\nふじのくにDX推進計画(仮称)骨子案vol.1\nふじのくにDX推進計画(仮称)骨子案vol.2-1\nふじのくにDX推進計画(仮称)骨子案vol.2-2\nふじのくにDX推進計画(仮称)骨子案vol.3-1\nふじのくにDX推進計画(仮称)骨子案vol.3-2\nSDOモバイルパソコンの配付の意義\nデジタル戦略局広報チーム結成\n“スマートウォッチを買ってみたvol.1”~身近なDX~\n“スマートウォッチを買ってみたvol.2”~身近なDX~\nアイデアソンとハッカソン~オープンデータの利活用~vol.1\nアイデアソンとハッカソン~オープンデータの利活用~vol.2\nポケモンGOとデータ分析vol.1~出会い~\nポケモンGOとデータ分析vol.2~挑戦~\nポケモンGOとデータ分析vol.3~執念~\nポケモンGOとデータ分析vol.4~分析(情報発信)~\nポケモンGOとデータ分析vol.5~分析(行動パターン)~\nふじのくにDX推進計画(仮称)の素案策定の過程~関係団体との対話~\n部長室と花(4月分から6月分まで)\n防災の日から熱海市伊豆山地区土石流災害に思うこと\n県庁若手職員によるDX推進チームへの期待\nふじのくにDX推進事業の現状\nここから本文です。\n更新日:令和3年7月2日\nアイデアソンとハッカソン~オープンデータの利活用~vol.2\n初めて、アイデアソンとハッカソンと聞いた時「何それ?」って思った。\nアイデアソンは、新しいアイデアを生み出すためのイベントである。1990年頃アメリカで使われ始めたと言われている。ハッカソンが主に物を作るということに対して、アイデアを生むことに重きを置いたイベントである。byウィキペディア(外部サイトへリンク)\n私は、地域振興に携わる仕事が多かった。牧之原市へ3年間、出向をしていたことがあったが、その時も地元住民とのワークショップをたくさん実施した。地域課題の解決の手法として既にアイデアソンのようなことは数多くこなしてきていたのだ。\nワークショップもアイデアソンも参加者の様々な意見がベースになって、一定の方向性が出て結論に持って行くことになるが、意見がうまく集約されるかバラバラに終わるかは、ファシリテーターの力量によっても変わってくる。\n今回は、“Codeforふじのくに”と連携してアイデアソンやハッカソンを開催していく。\n“Codeforふじのくに”とは、市民エンジニアらがITを活用し、「シビックテック」の手法を用いて、行政サービスや地域課題の解決に取り組む団体。2015年設立で、2013年に立ち上がった“CodeforJAPAN”とパートナーシップを結ぶ。全国にそのような団体は100近くある。\n“Codeforふじのくに”市川氏\nCodeforJAPANは、通常なら3ヶ月はかかるという東京都の新型コロナ対策サイトをわずか数日で立ち上げ、遅い、ダサい、使えない官製サイトの常識を覆し使いやすいインターフェスを作り上げた。この時のシビックテックの力が大きく注目された。\nデジタル戦略局では、今回、オープンデータを活用して地域課題を解決するアイデアソンを実施するのだが、社会のデジタル化を進めていく中で、データの活用が非常に重要だと考えており、蓄積された膨大な量のデータから新たな価値を創造していくことが、これからの社会で求められていくことから、まず、データを活用する機会を実際に体験してもらい、データを活用することが大事だと言うことを多くの人に知ってもらいたい。\nアイデアソンは、8月下旬から9月にかけて、県内4カ所で開催し、その後、その流れを受けて、県内1カ所で、ハッカソンを実施したいと考えている。\n是非、多くの学生をはじめ、地域の方々や行政職員にも参加していただきたい。\nお問い合わせ\n知事直轄組織デジタル戦略局デジタル戦略課\n〒420-8601静岡市葵区追手町9-6\n電話番号:054-221-3679\nファックス番号:054-251-4091\nメール:digital@pref.shizuoka.lg.jp\nより良いウェブサイトにするためにみなさまのご意見をお聞かせください\nこのページの情報は役に立ちましたか?\n1:役に立った\n2:ふつう\n3:役に立たなかった\nこのページの情報は見つけやすかったですか?\n1:見つけやすかった\n2:ふつう\n3:見つけにくかった\nページの先頭へ戻る\n著作権・リンクについて\n個人情報保護について\nユニバーサルデザインに配慮したページ\n携帯電話向けページ\nリンク集\nサイトマップ\n〒420-8601 静岡県静岡市葵区追手町9番6号 電話番号(県庁案内):054-221-2455\nCopyright  Shizuoka Prefecture. All Rights Reserved.','2021-04-23 00:00:00','2021-09-10 00:00:00',NULL,'静岡県静岡市葵区追手町9番6号 電話番号(県庁案内):054-221-2455','静岡県静岡市葵区追手町9番6号 電話番号(県庁案内):054-221-2455 ',34.9768,138.383,0,0,'JPY','1360026845266149376','ぬまづ歴たび@日本初スマホ片手にタイムトラベル街歩きツアー','numazuht',0,0,'2021-09-12 04:50:33','2021-09-12 04:50:33',7,0,NULL);
